import React, { useState, useEffect } from "react";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import { Button, CardActionArea, CardActions } from "@mui/material";
import background from "./2.jpg";
import { useSelector, useDispatch } from "react-redux";
import { singleData } from "./dataReducer";

export default function ServiceUser(props) {
  const [data, setData] = useState({});
  const filterData = useSelector((state) => state.service.singleData);

  const dispatch = useDispatch();

  useEffect(() => {
    fetch("http://localhost:3001/users")
      .then((res) => res.json())
      .then((res) => {
        dispatch(singleData(res.users[res.users.length - 1]));
      });
  });

  return (
    <div
      style={{
        backgroundImage: `url(${background})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "100% 100%",
        height: "100vh",
        width: "100%",
      }}
    >
      {" "}
      <Card
        sx={{
          maxWidth: 445,
          maxHeight: 400,
          paddingTop: 3,
          position: "relative",
          top: "20%",
          left: "38%",
          boxShadow: "gray 5px 9px  10px",
        }}
      >
        <CardActionArea>
          <CardContent>
            <Typography gutterBottom variant="h4" component="div">
              Name : {data.first_name} {data.last_name} <br />
            </Typography>
            <Typography variant="h6" color="text.secondary">
              {" "}
              Email : {data.email} <br />
              Mobile : {data.mob_no} <br />
              Price : {data.price} Rs/-
              <br />
              Service : {data.role}
              <br />
              Address : {data.address}
              <br />
              Rating : {data.rating}
              <br />
              Id : {data.id}
            </Typography>
          </CardContent>
        </CardActionArea>

        <CardActions>
          <Button size="large" color="primary">
            Edit Details
          </Button>
          <Button onClick={() => props.history.push("/dashboard")}>
            Dashboard
          </Button>
        </CardActions>
      </Card>
    </div>
  );
}
